import React from 'react';
import HEAD from './CODE/HEAD/HEAD.js'
// import CONTENT from './CODE/CONTENT/CONTENT.js'
import FOOTER from './CODE/FOOTER/FOOTER'
import s from './App.module.css'
import { BrowserRouter, Route } from 'react-router-dom';

import Order_Shophop from './CODE/CONTENT/order_Shop/order_Shop'
import Oficial_shoop from './CODE/CONTENT/oficial_shoop/Oficial_shoop'



function App() {
  return (
    <BrowserRouter>
      <div className={s.wrapper}>
        <HEAD />
        {/* <CONTENT /> */}
        <div>
          <Route component={Order_Shophop} />
          <Route component={Oficial_shoop} />
        </div>
        <FOOTER />
      </div>
    </BrowserRouter>
  );
}

export default App;
